import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Funds.css';

const Funds = () => {
  const [results, setResults] = useState([]);

  useEffect(() => {
    const fetchResults = async () => {
      try {
        const API_URL = 'https://api.sec-api.io/?token=6b3bf19df1784cb1a59bf55a7834ca93a3e59ec3cdc6d629837d96b711f99a5e';
        const requestBody = {
          query: 'formType:"NPORT-P"',
          from: '0',
          size: '200',
          sort: [{ filedAt: { order: 'desc' } }]
        };

        const response = await axios.post(API_URL, requestBody, {
          headers: {
            'Content-Type': 'application/xml'
          }
        });

        const data = response.data.filings;
        const filingDetails = await Promise.all(
          data.map(async (item) => {
            const proxyUrl = `http://localhost:4000/proxy?url=${encodeURIComponent(item.linkToFilingDetails)}`;
            const filingResponse = await axios.get(proxyUrl);
            const parser = new DOMParser();
            const xmlDoc = parser.parseFromString(filingResponse.data, "text/xml");
            const returnInfo = xmlDoc.querySelector('ItemB5ReturnInformation');

            if (returnInfo) {
              const monthlyReturns = [
                parseFloat(returnInfo.querySelector('MonthlyTotalReturnsMonth1').textContent),
                parseFloat(returnInfo.querySelector('MonthlyTotalReturnsMonth2').textContent),
                parseFloat(returnInfo.querySelector('MonthlyTotalReturnsMonth3').textContent)
              ];
              return {
                name: xmlDoc.querySelector('FundName').textContent,
                position: xmlDoc.querySelector('Position').textContent,
                year: xmlDoc.querySelector('Year').textContent,
                monthlyReturns,
                classIdentificationNumber: returnInfo.querySelector('ClassIdentificationNumber').textContent
              };
            }
            return null;
          })
        );

        const filteredResults = filingDetails.filter(item => item !== null);
        setResults(filteredResults);
      } catch (error) {
        console.error('There was an error fetching the data!', error);
        setResults([]); // Clear results on error
      }
    };

    fetchResults();
  }, []);

  const calculateMER = (monthlyReturns) => {
    const averageReturn = monthlyReturns.reduce((acc, val) => acc + val, 0) / monthlyReturns.length;
    return (averageReturn * 12).toFixed(2);
  };

  return (
    <div className="search-container1">
      <h2>Funds Return Information</h2>
      <div className="search-results1">
        {results.map((result, index) => (
          <div key={index} className="search-result1">
            <p><strong>Name:</strong> {result.name}</p>
            <p><strong>Position:</strong> {result.position}</p>
            <p><strong>Year:</strong> {result.year}</p>
            <p><strong>Class Identification Number:</strong> {result.classIdentificationNumber}</p>

            <h3>Monthly Total Return Record</h3>
            {result.monthlyReturns && (
              <div>
                {result.monthlyReturns.map((returnData, idx) => (
                  <p key={idx}>{`Month ${idx + 1}: ${returnData}`}</p>
                ))}
                <p><strong>MER (Annual):</strong> {calculateMER(result.monthlyReturns)}%</p>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Funds;
